package patten_matching;

public class Squar_fill_pattern {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int num = 5;
		
		for (int i = 1; i <=num; i++) {
			for (int j = 1; j <=num; j++) {
				System.out.print("* ");
			}
			System.out.println();
			
		}
		

	}

}
